import React from 'react';
import './App.css';
import { Button } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <nav className="navbar navbar-expand-sm navbar-light bg-light fixed-top border-bottom clearfix shadow-sm p-3 mb-5 bg-white rounded navbar header">
            <div className="container pt-2">
                <a className="navbar-brand align-middle" href="Server.php">Server</a>
                <button className="navbar-toggler" data-toggle="collapse" data-target="#navbarNav">
                <span className="navbar-toggler-icon"></span></button>

                <div className="collapse navbar-collapse" id="navbarNav">

                    <div className="ml-auto">
                        <input type="text" className="form-control search" id="search" placeholder="Search"/>
                    </div>

                    <button className="btn btn-primary ml-auto" data-toggle='modal' data-target='#Upload'>Upload</button>

                </div>
            </div>
      </nav>
      <div className='body'>



      <h1>Hello world</h1>
      <Button className='btn btn-primary'>aaa</Button>
      </div>
    </div>
  );
}

export default App;
